import React from "react";
import "./Home.css";

function Home() {
  return (
    <>
      <div className="home">
        <div className="home_left">
          <img className="home_img" src="./images/helpng.png" alt="not image" />
        </div>
        <div className="home_right">
          <strong className="home_name">Ashi Helmets</strong>
          <p>
            Avail <sub>upto</sub>60% discount
          </p>
        </div>
      </div>
    </>
  );
}

export default Home;
